import React, {useEffect} from "react";
//import Video from "../components/Video";
//import VideoContainer from "../components/VideoContainer";
import styled, {css} from "styled-components";


function RoomTitle() {
  useEffect(() => {
    document.title = "Room";
  });
}

function Room() {
  return (
    <RoomLayout>
      <RoomTitle></RoomTitle>
      <main>
      <Container>
        <video></video>
        <video></video>
        <video></video>
        <video></video>
      </Container>
      </main>

      <footer>
        <Footer>
        <div></div>
        <div>
        <Button>
         
            <button className="mute" type="submit" height="30px" width="30px" >
              <img src="microphone" height="27px" width="27px"></img></button>
          
            <button className="camera" type="submit" height="30px" width="30px">
              <img src="./././public/microphone.png" height="27px" width="27px"></img></button>
          
            <button className="out" type="submit" height="30px" width="30px">
              <img src="./././public/microphone.png" height="27px" width="27px"></img></button>
          
        </Button>  
        </div>
        <div></div>
        </Footer>
      </footer>
    
    </RoomLayout>
  );
  
  
}

const RoomLayout = styled.div`
  display:grid;
  width: 100%;
  height: 100%;
  grid-template-areas:
    "main" "main" "main" 
    "footer" "footer" "footer";
  
  main{
    grid-row: 1/10;
    height: 80%;
    width: 100%;
    
  }
  footer{
    grid-row: 10/12;
    height: 40px;
    width: 100%;
    position: fixed;
    bottom: 0;
  }
  
`

const Container = styled.div`
display: grid;
grid-template-columns: 1fr 1fr;


`

const Footer = styled.div`
display: flex;
justify-content: space-around;
align-items: center;

`
const Button = styled.div`
display: flex;
gap: 10px;
`

export default Room;

